package cn.com.easyerp.core.cache;

public class CityDescribe {
    private String code;
    private String name;
    private String entrustment;
    private String contacts;
    private String phone;
    private String email;
    private String address;
    private String employer_firms;
    private String owner;

    public String getCode() {
        return this.code;
    }

    public void setCode(String code) {
        this.code = code;
    }

    public String getName() {
        return this.name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getEntrustment() {
        return this.entrustment;
    }

    public void setEntrustment(String entrustment) {
        this.entrustment = entrustment;
    }

    public String getContacts() {
        return this.contacts;
    }

    public void setContacts(String contacts) {
        this.contacts = contacts;
    }

    public String getPhone() {
        return this.phone;
    }

    public void setPhone(String phone) {
        this.phone = phone;
    }

    public String getEmail() {
        return this.email;
    }

    public void setEmail(String email) {
        this.email = email;
    }

    public String getAddress() {
        return this.address;
    }

    public void setAddress(String address) {
        this.address = address;
    }

    public String getEmployer_firms() {
        return this.employer_firms;
    }

    public void setEmployer_firms(String employer_firms) {
        this.employer_firms = employer_firms;
    }

    public String getOwner() {
        return this.owner;
    }

    public void setOwner(String owner) {
        this.owner = owner;
    }
}
